CREATE TABLE "QDATA"."SYSTEM_NOTICE"
(
    "NOTICE_ID" INT IDENTITY(11, 1) NOT NULL,
    "NOTICE_TITLE" VARCHAR(50) NOT NULL,
    "NOTICE_TYPE" CHAR(1) NOT NULL,
