    "STATUS" CHAR(1) DEFAULT '0',
    "CREATE_BY" VARCHAR(64) DEFAULT '',
    "CREATE_TIME" TIMESTAMP(0),
    "UPDATE_BY" VARCHAR(64) DEFAULT '',
    "UPDATE_TIME" TIMESTAMP(0),
    "REMARK" VARCHAR(255),
    NOT CLUSTER PRIMARY KEY("NOTICE_ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."SYSTEM_NOTICE" IS '通知公告表';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."CREATE_BY" IS '创建者';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."NOTICE_CONTENT" IS '公告内容';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."NOTICE_ID" IS '公告ID';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."NOTICE_TITLE" IS '公告标题';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."NOTICE_TYPE" IS '公告类型（1通知 2公告）';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."STATUS" IS '公告状态（0正常 1关闭）';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."UPDATE_BY" IS '更新者';
COMMENT ON COLUMN "QDATA"."SYSTEM_NOTICE"."UPDATE_TIME" IS '更新时间';

