-- ----------------------------
-- 操作日志记录
-- ----------------------------
CREATE TABLE "QDATA"."SYSTEM_OPER_LOG"
(
    "OPER_ID" BIGINT IDENTITY(922, 1) NOT NULL,
    "TITLE" VARCHAR(50) DEFAULT '',
    "BUSINESS_TYPE" INT DEFAULT 0,
    "METHOD" VARCHAR(200) DEFAULT '',
    "REQUEST_METHOD" VARCHAR(10) DEFAULT '',
    "OPERATOR_TYPE" INT DEFAULT 0,
    "OPER_NAME" VARCHAR(50) DEFAULT '',
    "DEPT_NAME" VARCHAR(50) DEFAULT '',
    "OPER_URL" VARCHAR(255) DEFAULT '',
    "OPER_IP" VARCHAR(128) DEFAULT '',
    "OPER_LOCATION" VARCHAR(255) DEFAULT '',
    "OPER_PARAM" CLOB DEFAULT '',
    "JSON_RESULT" CLOB DEFAULT '',
    "STATUS" INT DEFAULT 0,
    "ERROR_MSG" VARCHAR(2000) DEFAULT '',
    "OPER_TIME" TIMESTAMP(0),
    "COST_TIME" BIGINT DEFAULT 0,
    NOT CLUSTER PRIMARY KEY("OPER_ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."SYSTEM_OPER_LOG" IS '操作日志记录';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."BUSINESS_TYPE" IS '业务类型（0其它 1新增 2修改 3删除）';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."COST_TIME" IS '消耗时间';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."DEPT_NAME" IS '部门名称';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."ERROR_MSG" IS '错误消息';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."JSON_RESULT" IS '返回参数';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."METHOD" IS '方法名称';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPER_ID" IS '日志主键';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPER_IP" IS '主机地址';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPER_LOCATION" IS '操作地点';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPER_NAME" IS '操作人员';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPER_PARAM" IS '请求参数';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPER_TIME" IS '操作时间';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPER_URL" IS '请求URL';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."OPERATOR_TYPE" IS '操作类别（0其它 1后台用户 2手机端用户）';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."REQUEST_METHOD" IS '请求方式';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."STATUS" IS '操作状态（0正常 1异常）';
COMMENT ON COLUMN "QDATA"."SYSTEM_OPER_LOG"."TITLE" IS '模块标题';


CREATE OR REPLACE  INDEX "QDATA"."IDX_SYS_OPER_LOG_BT" ON "QDATA"."SYSTEM_OPER_LOG"("BUSINESS_TYPE" ASC) STORAGE(ON "MAIN", CLUSTERBTR) ;
CREATE OR REPLACE  INDEX "QDATA"."IDX_SYS_OPER_LOG_OT" ON "QDATA"."SYSTEM_OPER_LOG"("OPER_TIME" ASC) STORAGE(ON "MAIN", CLUSTERBTR) ;
CREATE OR REPLACE  INDEX "QDATA"."IDX_SYS_OPER_LOG_S" ON "QDATA"."SYSTEM_OPER_LOG"("STATUS" ASC) STORAGE(ON "MAIN", CLUSTERBTR) ;


-- ----------------------------
-- 定时任务调度表
-- ----------------------------
CREATE TABLE "QDATA"."SYSTEM_JOB"
(
    "JOB_ID" BIGINT IDENTITY(1, 1) NOT NULL,
    "JOB_NAME" VARCHAR(64) DEFAULT '' NOT NULL,
    "JOB_GROUP" VARCHAR(64) DEFAULT 'DEFAULT' NOT NULL,
    "INVOKE_TARGET" VARCHAR(500) NOT NULL,
    "CRON_EXPRESSION" VARCHAR(255) DEFAULT '',
    "MISFIRE_POLICY" VARCHAR(20) DEFAULT '3',
    "CONCURRENT" CHAR(1) DEFAULT '1',
    "STATUS" CHAR(1) DEFAULT '0',
    "CREATE_BY" VARCHAR(64) DEFAULT '',
    "CREATE_TIME" TIMESTAMP(0),
    "UPDATE_BY" VARCHAR(64) DEFAULT '',
    "UPDATE_TIME" TIMESTAMP(0),
    "REMARK" VARCHAR(500) DEFAULT '',
    NOT CLUSTER PRIMARY KEY("JOB_ID", "JOB_NAME", "JOB_GROUP")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."SYSTEM_JOB" IS '定时任务调度表';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."CONCURRENT" IS '是否并发执行（0允许 1禁止）';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."CREATE_BY" IS '创建者';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."CRON_EXPRESSION" IS 'cron执行表达式';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."INVOKE_TARGET" IS '调用目标字符串';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."JOB_GROUP" IS '任务组名';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."JOB_ID" IS '任务ID';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."JOB_NAME" IS '任务名称';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."MISFIRE_POLICY" IS '计划执行错误策略（1立即执行 2执行一次 3放弃执行）';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."REMARK" IS '备注信息';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."STATUS" IS '状态（0正常 1暂停）';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."UPDATE_BY" IS '更新者';
COMMENT ON COLUMN "QDATA"."SYSTEM_JOB"."UPDATE_TIME" IS '更新时间';

-- ----------------------------
