-- ----------------------------
-- API服务
-- ----------------------------
CREATE TABLE "QDATA"."DS_API"
(
"ID" BIGINT IDENTITY(3, 1) NOT NULL,
"CAT_ID" BIGINT NOT NULL,
"CAT_CODE" VARCHAR2(128) NOT NULL,
"NAME" VARCHAR2(128) NOT NULL,
"API_VERSION" VARCHAR2(32) NOT NULL,
"API_URL" VARCHAR2(1024) NOT NULL,
"REQ_METHOD" CHAR(1) NOT NULL,
"API_SERVICE_TYPE" CHAR(1) NOT NULL,
"RES_DATA_TYPE" CHAR(1) NOT NULL,
"DENY_IP" TEXT,
"CONFIG_JSON" TEXT,
"LIMIT_JSON" VARCHAR2(128),
"REQ_PARAMS" TEXT,
"RES_PARAMS" TEXT,
"DESCRIPTION" VARCHAR2(512),
"STATUS" CHAR(1) DEFAULT 0 NOT NULL,
"VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
"DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
"CREATE_BY" VARCHAR2(32),
"CREATOR_ID" BIGINT,
"CREATE_TIME" DATETIME(6) DEFAULT CURRENT_TIMESTAMP,
"UPDATE_BY" VARCHAR2(32),
"UPDATER_ID" BIGINT,
"UPDATE_TIME" DATETIME(6) DEFAULT CURRENT_TIMESTAMP,
"REMARK" VARCHAR2(512),
"TRANSMIT_TYPE" CHAR(1),
"API_ID" BIGINT,
"HEADER_JSON" TEXT,
NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."DS_API" IS 'API服务';
COMMENT ON COLUMN "QDATA"."DS_API"."API_ID" IS 'API id';
COMMENT ON COLUMN "QDATA"."DS_API"."API_SERVICE_TYPE" IS '服务提供类型;1：单表向导式，2：SQL脚本式，3：三方转发';
COMMENT ON COLUMN "QDATA"."DS_API"."API_URL" IS 'API路径';
COMMENT ON COLUMN "QDATA"."DS_API"."API_VERSION" IS 'API版本';
COMMENT ON COLUMN "QDATA"."DS_API"."CAT_CODE" IS '类目编码';
COMMENT ON COLUMN "QDATA"."DS_API"."CAT_ID" IS '类目id';
COMMENT ON COLUMN "QDATA"."DS_API"."CONFIG_JSON" IS '执行配置JSON';
COMMENT ON COLUMN "QDATA"."DS_API"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DS_API"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DS_API"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DS_API"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DS_API"."DENY_IP" IS 'IP黑名单多个，隔开';
COMMENT ON COLUMN "QDATA"."DS_API"."DESCRIPTION" IS '描述';
COMMENT ON COLUMN "QDATA"."DS_API"."HEADER_JSON" IS 'Header配置json';
COMMENT ON COLUMN "QDATA"."DS_API"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."DS_API"."LIMIT_JSON" IS '限流配置JSON';
COMMENT ON COLUMN "QDATA"."DS_API"."NAME" IS 'API服务名称';
COMMENT ON COLUMN "QDATA"."DS_API"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."DS_API"."REQ_METHOD" IS '请求方式;1：get，2：post';
COMMENT ON COLUMN "QDATA"."DS_API"."REQ_PARAMS" IS '请求参数';
COMMENT ON COLUMN "QDATA"."DS_API"."RES_DATA_TYPE" IS '返回结果类型;1：详情，2：列表，3：分页';
COMMENT ON COLUMN "QDATA"."DS_API"."RES_PARAMS" IS '返回参数';
COMMENT ON COLUMN "QDATA"."DS_API"."STATUS" IS '状态;0：不启用，1启用';
COMMENT ON COLUMN "QDATA"."DS_API"."TRANSMIT_TYPE" IS '转发类型;1:API 2:地理空间数据';
COMMENT ON COLUMN "QDATA"."DS_API"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "QDATA"."DS_API"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "QDATA"."DS_API"."UPDATER_ID" IS '更新人id';
COMMENT ON COLUMN "QDATA"."DS_API"."VALID_FLAG" IS '是否有效;0：无效，1：有效';

