-- ----------------------------
-- 数据资产-矢量表
-- ----------------------------
CREATE TABLE "QDATA"."DA_ASSET_GEO"
(
    "ID" BIGINT IDENTITY(3, 1) NOT NULL,
    "ASSET_ID" BIGINT NOT NULL,
    "FILE_NAME" VARCHAR2(128) NOT NULL,
    "FILE_URL" VARCHAR2(256) NOT NULL,
    "ELEMENT_TYPE" CHAR(1) NOT NULL,
    "COORDINATE_SYSTEM" VARCHAR2(32) NOT NULL,
    "VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
    "DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
    "CREATE_BY" VARCHAR2(32),
    "CREATOR_ID" BIGINT,
    "CREATE_TIME" DATETIME(6) DEFAULT CURRENT_TIMESTAMP NOT NULL,
    "UPDATE_BY" VARCHAR2(32),
    "UPDATER_ID" BIGINT,
    "UPDATE_TIME" DATETIME(6) DEFAULT CURRENT_TIMESTAMP NOT NULL,
    "REMARK" VARCHAR2(512),
    "STATUS" CHAR(1) DEFAULT 1,
    "FILE_TYPE" VARCHAR2(32) NOT NULL,
    NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."DA_ASSET_GEO" IS '数据资产-矢量表';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."ASSET_ID" IS '资产id';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."COORDINATE_SYSTEM" IS '坐标系';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."ELEMENT_TYPE" IS '要素类型;1:点 2:线 3:面 (混合多选一逗号隔开)';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."FILE_NAME" IS '文件名称';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."FILE_TYPE" IS '文件类型;例如 pdf/doc/txt等';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."FILE_URL" IS '文件路径';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."STATUS" IS '状态;1:未发布 2:已发布';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."UPDATER_ID" IS '更新人id';
COMMENT ON COLUMN "QDATA"."DA_ASSET_GEO"."VALID_FLAG" IS '是否有效;0：无效，1：有效';

SET IDENTITY_INSERT "QDATA"."DA_ASSET_GEO" ON;
