-- ----------------------------
-- 物化模型记录表
-- ----------------------------
CREATE TABLE "QDATA"."DP_MODEL_MATERIALIZED"
(
    "ID" BIGINT IDENTITY(1, 1) NOT NULL,
    "MODEL_NAME" VARCHAR2(256) NOT NULL,
    "MODEL_ALIAS" VARCHAR2(2000) NOT NULL,
    "MODEL_ID" BIGINT NOT NULL,
    "STATUS" CHAR(1) DEFAULT 0 NOT NULL,
    "MESSAGE" TEXT,
    "SQL_COMMAND" VARCHAR2(3072),
    "DATASOURCE_ID" BIGINT NOT NULL,
    "DATASOURCE_TYPE" VARCHAR2(32) NOT NULL,
    "DATASOURCE_NAME" VARCHAR2(128) NOT NULL,
    "ASSET_ID" BIGINT,
    "VALID_FLAG" VARCHAR2(1) DEFAULT 1 NOT NULL,
    "DEL_FLAG" VARCHAR2(1) DEFAULT 0 NOT NULL,
    "CREATE_BY" VARCHAR2(32),
    "CREATOR_ID" BIGINT,
    "CREATE_TIME" DATETIME(6) DEFAULT CURRENT_TIMESTAMP NOT NULL,
    "UPDATE_BY" VARCHAR2(32),
    "UPDATER_ID" BIGINT,
    "UPDATE_TIME" DATETIME(6) DEFAULT CURRENT_TIMESTAMP NOT NULL,
    "REMARK" VARCHAR2(512),
    NOT CLUSTER PRIMARY KEY("ID")) STORAGE(ON "MAIN", CLUSTERBTR) ;

COMMENT ON TABLE "QDATA"."DP_MODEL_MATERIALIZED" IS '物化模型记录表';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."ASSET_ID" IS '资产表id';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."CREATOR_ID" IS '创建人id';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."DATASOURCE_ID" IS '数据源id';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."DATASOURCE_NAME" IS '数据源名称';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."DATASOURCE_TYPE" IS '数据源类型';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."DEL_FLAG" IS '删除标志;1：已删除，0：未删除';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."ID" IS 'ID';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."MESSAGE" IS '执行日志信息';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."MODEL_ALIAS" IS '模型名称;表描述、名称';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."MODEL_ID" IS '模型表id';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."MODEL_NAME" IS '模型编码;表名';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."REMARK" IS '备注';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."SQL_COMMAND" IS '执行sql备份';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."STATUS" IS '状态;1未创建，2创建中，3成功，4失败，5已存在。';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."UPDATER_ID" IS '更新人id';
COMMENT ON COLUMN "QDATA"."DP_MODEL_MATERIALIZED"."VALID_FLAG" IS '是否有效;0：无效，1：有效';
